  return (
    <div className = "cover" style= {{backgroundImage: `url(${image})`}}>
      <MenuBar />
      <head>
        <link href="https://fonts.googleapis.com/css2?family=Playfair+Display+SC&display=swap" rel="stylesheet"> </link>
        <title>Judy Zhang</title>
      </head>
      <body>
      </body>
      </div>
  );
  }
}

export default App;
